style.css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain(nordjyske.dk)
{
	body { /* Main background */
	background:url('data:image/png;base64,') repeat;
  }
  p, .native-layout-container .native-wrapper .main p { /*Small text shown*/
    color: #fff;
    text-shadow: #000 2.1px 2.3px;
	}
  body .modal-content .modal-header h3 { /* H3 Header */
    color: #bbb;
    text-shadow: #000 1.4px 2.4px;
	}
  .close, .signup-bar .close-dib { /*Condition Close, Signup Close*/
    color: #fff;
    text-shadow: #000 1.5px 2.5px;
    opacity: .4;
	}
  body header, body header .top-bar { /* Main Top Nav Bar Sides Background */
		background: linear-gradient(to bottom, #45484d 0%, #000000 100%);
    box-shadow: none;
	}
  nav.navbar, nav.navbar ul.nav > li.dropdown.open a.dropdown-toggle::after, nav.navbar ul.nav > li.dropdown.open a.dropdown-toggle { /* Main Top Nav Bar Middle Background */
    background: transparent;
	}
  nav.navbar ul.nav > li > a {
    color: #bbb;
    border-bottom: 3px solid #292929;
	}
  nav.navbar ul.nav > li > a:hover {
    color: #ccc;
	}
  nav.navbar ul.nav > li.dropdown .dropdown-menu .dropdown-menu-left-col li.active > a, nav.navbar ul.nav > li.dropdown .dropdown-menu .dropdown-menu-right-col li.active > a {
    color: #c93c2e;
	}
  nav.navbar ul.nav > li.dropdown .dropdown-menu .dropdown-menu-left-col li a, nav.navbar ul.nav > li.dropdown .dropdown-menu .dropdown-menu-right-col li a { /*Drop down text left, Drop down text right*/
    border-bottom: 3px solid #292929;
	}
  body .container, .section-wrapper .theme, .todays-paper, .cartrade .select-criteria button, .article-layout-container .print-to-web-row { /* Main Top Nav Bar Middle Text Background, Middle Theme Background, Our paper ad, Car ad dropdown box, article related box*/
    background-color: #232323;
	}
  body header .top-bar .top-bar-tools ul > li a, body header .top-bar .top-bar-tools ul > li a div { /* Nav Tools, Nav Text*/
    color: #fff;
	}
  .latest-news-detailed::after, .most-read-detailed::after, .article-layout-container .article-plus-wrapper .content .locked p:last-of-type::after { /*Latest News Feed Bottom Shade Background, Most Read Bottom Shade*/
    background: linear-gradient(to top,#3b3b3b80 5%, rgba(20, 20, 20, 0.23) 95%);
	}
  .story-teaser-small, .col-xs-4 .story-teaser .text-wrapper, .native-teaser .text-wrapper, .col-xs-6.smallRow .story-teaser .text-wrapper, .signup-bar, .modal-content, .cartrade, #jobbox, #jobbox .panel, .focus-element, .col-xs-4 .story-teaser-text .text-wrapper, .col-xs-6.restaurantRatingBottom .story-teaser .text-wrapper { /* Main Articles Backgrounds Front Page, Bottom Signup bar, conditions box, car ads, Upper ad*/
		background: linear-gradient(to bottom, #45484d 0%,#000000 100%);
	}
  body .section-wrapper h2, .story-teaser-small .text-wrapper h2, .col-xs-3 .story-teaser .text-wrapper h2, .col-xs-4 .story-teaser .text-wrapper h2, .col-xs-6.smallRow .story-teaser, .native-teaser .text-wrapper h2, .col-xs-6.smallRow .story-teaser .text-wrapper h2, .latest-news-detailed ul li a, .most-read-detailed ul li a, #jobbox .panel #jobdetail .jobdetail-wrapper .job-company, .latest-news ul li a, .most-read ul li a, .todays-paper ul li a, .col-xs-4 .story-teaser-text .text-wrapper h3, .col-xs-6.restaurantRatingBottom .story-teaser .text-wrapper h2 {
    color: #fff;
	}
  .container-fluid.article, .article .container-fluid, .dropdown-menu, .article-layout-container .article-plus-wrapper, .native-layout-container .native-wrapper { /*Main Article Background Reader, Article Side, .dropdown-menu*/
		background: linear-gradient(to bottom, #000000 0%,#45484d 100%);
	}
  .article .content .heading, .article-layout-container .article-plus-wrapper .heading { /*Article head*/
    color: #fff;
    text-shadow: #0c0c0c 1.5px 1px;
	}
  .article .content .subheading, .article-layout-container .article-plus-wrapper .subheading { /*Sub header*/
    color: #a1a1a1;
    text-shadow: #000 0px 0px;
	}
  .article .content .main h3 { /*H3 middle artcle*/
    color: #a1a1a1;
    text-shadow: #000 2px 2px;
	}
  .latest-news-detailed, .most-read-detailed { /*Side bar - latest news feed outer background, Most read background*/
    background-color: #181818;
	}
  body footer .links ul li a, .latest-news-detailed ul li a, .latest-news, .most-read { /*Footer links background, Latest News Feed Inner Background*/
    background-color: transparent;
	}
  body footer .links a, nav.navbar ul.nav > li.dropdown.open a { /*Footer links color*/
    color: #e1e1e1;
	}
  #jobbox .panel #jobdetail .jobdetail-wrapper .job-title, .latest-news-detailed h3, .most-read-detailed h3, .latest-news h3, .most-read h3, .todays-paper h3, .article-layout-container .teaser-section h2.title {
    color: #555;
	}
  .article .content .comments-container .comments-accordion-content .comment-editor .commenter-container span { /*login to comment text*/
    color: #141414;
	}
  body footer .links ul li .address { /*Footer address*/
    color: #d23737;
    text-shadow: 0px 2px #000;
  }
  .gigya-style-modern div.gigya-screen-dialog-inner { /*Create user / login box background*/
    background-color: #000;
	}
  .story-teaser, .story-teaser-text, .story-teaser-small, .local-teaser {
    z-index: inherit;
    opacity: 1.0;
    box-shadow: 0 0 15px transparent;
    transition: all 1s;
	}
  .story-teaser:hover, .story-teaser-text:hover, .story-teaser-small:hover, .local-teaser:hover {
    z-index: 99999;
    opacity: 0.7;
    box-shadow: 0 0 15px #555;
    transition: all 1s;
    transform: scale(1.05);
	}
  .localnews .ln-list li a, .latest-news ul li a, .most-read ul li a, .todays-paper ul li a, .latest-news-detailed ul li a, .most-read-detailed ul li a, body footer .links a, a[href*="https://bilhandel.nordjyske.dk/"] {
    opacity: 1;
    text-decoration: none;
    transition: ease 1s;
  }
  .localnews .ln-list li a:hover, .latest-news ul li a:hover, .most-read ul li a:hover, .todays-paper ul li a:hover, .latest-news-detailed ul li a:hover, .most-read-detailed ul li a:hover, body footer .links a:hover, a[href*="https://bilhandel.nordjyske.dk/"]:hover {
    opacity: 0.5;
    text-decoration: underline;
  }
  .dropdown-menu > li > a { /*Car ad drop down text*/
    color: #fff;
	}
  .bootstrap-select.btn-group .dropdown-menu li a:hover { /*Hover car ad drop down text*/
    background-color: rgba(255, 255, 255, 0.2);
	}
  .cartrade .latest-cars .car a .car-text-wrapper .title, .native-layout-container .native-wrapper .main .factbox .factbox-body > h4 { /*Car ad list title*/
    color: #aaa;
	}
  .cartrade .latest-cars .car a .car-text-wrapper .details { /* Car ad km */
    color: #555;
	}
  .cartrade .dropdown-toggle, .cartrade .select-criteria button { /* Car ad dropdown selected text color */
    color: #fff !important;
	}
  .cartrade .btn-sell-car { /*Sell your car btn */
    color: #ff4f55;
    border: 2px solid #fff;
	}
  .article-layout-container .article-plus-wrapper .main-image-container .article-main-image-text { /*gallery image sub header color*/
    color: #808080;
    text-shadow: 0px 1px #000;
	}
  .article-layout-container .article-plus-wrapper .content .no-access p.new-access {  /*Har du allerede købt adgang? text*/
    color: #e0e0e0;
	}
  ::selection {
    background-color: #C93C2E;
    color: #555;
    text-shadow: 1px 1px #000;
    box-shadow: 0 0 0 5px #555;
	}
  ::-moz-selection {
    background-color: #C93C2E;
    color: #555;
    text-shadow: 1px 1px #000;
    box-shadow: 0 0 0 5px #555;
	}
  .native-layout-container .native-wrapper .main .factbox {
    background-color: #141414;
		color: #fff;
	}
  .story-teaser.invalid-image-url {
		background-color: rgba(0, 0, 0, 0.9);
	}
  .story-teaser.invalid-image-url .text-wrapper h2 {
		color: #fff;
	}
  .story-teaser.invalid-image-url .text-wrapper {
  	color: #a1a1a1;
    text-shadow: #000 0px 0px;
	}
  .searchPage  {
    background-color: #151515;
	}
  .text-embed {
    color: #c23d26;
    text-shadow: 1px 1px #000;
	}
  .restaurant-ratings .row {
    background-color: #1d1d1d;
	}
	.restaurant-ratings .filter .kicker-text-container p {
    color: #fff;
	}
  .article .content .main, .article .top-container-wrapper .main {
    color: #a6a6a6;
  }
  blockquote {
    border-left: 5px solid #a6a6a6;
  }
  .article .content .main .readalso-link .link, .article .top-container-wrapper .main .readalso-link .link, .article .content .main .related-link-premium .text .link-title, .article .top-container-wrapper .main .related-link-premium .text .link-title, .article-layout-container .comic-strip .comic-text, .article .content .main .factbox .factbox-content .factbox-body .factbox-text, .localnews .ln-header .ln-header-text-wrapper .ln-header-text {
    color: #e7e7e7;
  }
  .article .content .main .readalso-link, .article .content .main .related-link-premium, .article .top-container-wrapper .main .related-link-premium, body .webtv, .epaper, .epaper .teaser .epaper-page-status, .epaper .teaser .store-teaser {
    background-color: #181818;
  }
  span[class="commenter-name"], .article-layout-container .teaser-section.plus .plus-teaser-w-image p, .localnews .ln-list li a time, body .webtv h3 {
    color:#888;
  }
  .article .content .main .factbox, .article .content .theme, body .webtv .webtvPrices-product-info, body .webtv .webtvPrices-product-info a {
    background: linear-gradient(to bottom, #45484d 0%,#000000 100%);
  }
  .article .content .main .factbox .factbox-content .factbox-body::before {
    background: linear-gradient(to bottom, rgba(0,0,0,0) 0%,rgba(255,255,255,0.2) 100%);
  }
  .localnews {
    border: 8px solid #252525;
    background-color: #181818;
  }
  .localnews .ln-list li a span, #jobbox .panel #jobdetail .jobdetail-wrapper .job-title, body .webtv h2, .article .content .theme .theme-title, #jobbox .panel #jobdetail .jobdetail-wrapper .job-title.small {
    color: #fff;
  }
  .localnews .ln-header .ln-header-text-wrapper img, img[src*="https://images.nordjyske.dk/doedsannoncer/"] {
    filter: invert(100%);
  }
  img[src="/content/images/epaper/mobile-devices.png"], img[src="/content/images/epaper/desktop-device.png"] {
    filter: invert(95%);
  }
  .epaper .moremagazines .category {
    border-bottom: 3px solid #888;
    color: #e7e7e7;
  }
  .important-message-row .important-message {
    background: linear-gradient(to bottom, #45484d 0%,#000000 100%);
    opacity: 1;
    box-shadow: 0 0 10px transparent;
    transition: box-shadow 1s;
  }
  body .important-message-row .important-message:hover {
    text-decoration: underline;
    opacity: 0.7;
    box-shadow: 0 0 10px #555;
    transition: box-shadow 1s;
  }
  .article .content .theme .theme-link .link {
    color: #888;
    opacity: 1;
    transition: ease 1s;
  }
  .article .content .theme .theme-link .link:hover {
    text-decoration: underline;
    opacity: 0.6;
    transition: ease 1s;
  }
	/*body .banner200 {
    min-height: 0px;
	}*/
  
  /*--------------------- Mobile ---------------------*/
  .mobile .section-rows-wrapper, .latest-mobile .latest-news, .mobile footer .app, .latest-mobile .most-read, .latest-mobile .most-read-detailed, body .leftslidemenu .menu, .article-bottom-sections.mobile .section-rows-wrapper {
    background-color: #232323;
  }
  .mobile footer .app p {
    color: #f1f1f1;
  }
  .latest-mobile .nav-tabs { /*Back navigation bar*/
    background: linear-gradient(to bottom, #000 0%,#232323 100%);
  }
  .latest-mobile .nav-tabs li > a { /*Unselected li*/
    background: transparent;
    color: #555;
  }
  .latest-mobile .nav-tabs li.active > a /*Selected li*/ {
    background: linear-gradient(to bottom, #45484d 0%,#232323 100%) !important;
    color: #fff !important;
  }
  .latest-mobile .nav > li > a:hover {
    background: linear-gradient(to bottom, #555 0%,#303030 100%);
    color: #fff;
  }
  .latest-mobile .nav-tabs .active {
    border: none;
    box-shadow: 0 1px #fff;
  }
  body header .mobile .navbar-default .navbar-toggle:hover, body header .mobile .navbar-default .navbar-toggle:focus {
    background-color: transparent;
  }
  .navbar-default .navbar-toggle .icon-bar {
    background-color: #e0e0e0;
  }
  body .leftslidemenu .menu .nav > li > a:hover, body .leftslidemenu .menu .nav > li > a:focus {
    background-color: transparent;
    color: #959595;
    text-decoration: underline;
  }
  body .leftslidemenu .menu .nav > li > a, .mobile .plus-teaser-w-image .text-wrapper h2 {
    color: #fff;
  }
  body .section-wrapper .news-section-load-more:hover {
    text-decoration: underline;
  }
  .mobile .plus-teaser-w-image .text-wrapper {
    background: linear-gradient(to bottom, #45484d 0%,#000000 100%);
  }
  .mobile .plus-teaser-w-image .text-wrapper .subheading {
    color: #c5c5c5;
  }
  /*Mobile Radio: */
  /*--------------------- Twitter ---------------------*/
  .EmbeddedTweet-tweet > blockquote {
    border: none;
  }
  p[class="Tweet-text e-entry-title"] {
    color: #14171a;
    text-shadow: none;
  }
}
